import React from "react"
import Ride from "./Ride.js"

const RideList = (props) => {
  const renderRide=()=>{
    return props.rides.map((ride,key)=>
    <Ride
      key={ride.id}
      ride={ride}
    />)

  }
  return (
  <div className="">

    {renderRide()}

  </div>
  )
}

export default RideList
